import React, { Component } from "react";
import SliderShow from "../components/SliderShow";
import { GridList } from "@material-ui/core";

class Home extends Component {
  render() {
    return (
      <div>
        <SliderShow />
        <GridList cols={4} cellHeight={400}>
          <img src={require("../")}/>
        </GridList>
      </div>
    );
  }
}

export default Home;
